About: From the director of Deep Throat comes a cerebral and well crafted film with a unique story that could only be portrayed properly under an X rating. Jamie Gillis and Terri Hall turn in superb performances in Gerard Daimano's exploration of macabre love, borne out of obedience, for a merciful but tragic task. The Story Of Joanna is indeed a story of love, love that knows no bounds and devotion that calls for commitment that very few would offer
